import React from 'react'
import s from './SideBar.module.css'
import SideBarItem from "./SideBarItem/SideBarItem";

const SideBar = (props) => {
    //let DialogMass = props.DialogData.map(dialog => <DialogItem name={dialog.name} id={dialog.id}/>)
    let SideBarContent = props.SideBarData.map(b => <SideBarItem name={b.name} img={b.img} />);

   console.log(props.SideBarData)
    return (
        <div className={s.SideBar}><p>Friends</p>
            <div className={s.SideBar_friends}>
                <SideBarItem SideBarData={props.SideBarData}/>
                <SideBarItem SideBarData={props.SideBarData}/>
                <SideBarItem SideBarData={props.SideBarData}/>

            </div>
        </div>
    )
}
export default SideBar
